import React from 'react';
import './App.css';

function LikeButton(){
  const [liked, setLike] = React.useState(false);

  const clicked = () => {
    setLike
  }
  const className = liked?'like':'liked';
  return <button className={className + ' likeBtn'} onClick={()=> clicked()}>Like</button>
}

function App() {
  return (
    <div className="App">
      <LikeButton />
    </div>
  );
}

export default App;
